import Vue from 'vue';
import Vuex from 'vuex';

import { account } from './account.module.js';

Vue.use(Vuex);

const store = new Vuex.Store({
  modules: {
    account: {
      ...account
    }
  }
});

console.log(store.state.account)

export default store;
